import React, { useState, useEffect, useRef } from "react";
import {
  IonHeader,
  IonPage,
  IonToolbar,
  IonTitle,
  IonContent,
  IonItem,
  IonLabel,
  IonInput,
  IonButton,
  IonText,
  IonBackButton,
  IonButtons,
} from "@ionic/react";
import { IUrlOptions } from "../models/rest-api.model";
import { RemoteService } from "../services/remote.service";

const InscriptionPage: React.FC = ({ history }: any) => {
  const remoteService = new RemoteService();
  const [error, setError] = useState({ error: false });
  const loginForm = useRef<HTMLFormElement>(null);

  useEffect(() => {
    let token = sessionStorage.getItem("userToken");
    console.log("loginForm :", loginForm);
    if (loginForm && loginForm.current) {
      loginForm.current.reset();
    }
    if (token) {
      history.push("/home");
    } else {
      history.push("/login");
    }
  }, []);

  const handleSubmit = (event: any) => {
    event.preventDefault();

    // Syntax : var formData = new FormData(form)
    // Ref : https://medium.com/@everdimension/how-to-handle-forms-with-just-react-ac066c48bd4f
    const form = event.target.closest("form");
    const formData = new FormData(form);

    const formDataObj = {
      nom: formData.get("nom"),
      prenom: formData.get("prenom"),
      dateNaissance: formData.get("datedenaissance"),
      mail: formData.get("mail"),
      mpd: formData.get("mdp"),
    };

    const options: IUrlOptions = {
      endPoint: `login`,
      restOfUrl: "",
      isSecure: true,
      contentType: "application/json",
    };

    remoteService.request("POST", options, formDataObj).then((data) => {
      if (formData.get("email") == "aa") {
        // data.username ="aa";
        console.log("yes");
        //sessionStorage.setItem('userToken', data.token);
        history.push("/home");
      } else {
        alert("vous avez pas de compte");
      }
    });
  };

  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonBackButton defaultHref="/login" />
          </IonButtons>
          <IonTitle></IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent>
        <form
          ref={loginForm}
          name="formLogin"
          id="formLogin"
          method="POST"
          onSubmit={handleSubmit}
          encType="multipart/form-data"
        >
          <IonItem>
            <IonLabel position="floating">Nom</IonLabel>
            <IonInput type="text" name="nom" id="nom"></IonInput>
          </IonItem>
          <IonItem>
            <IonLabel position="floating">Prenom</IonLabel>
            <IonInput type="text" name="prenom" id="prenom"></IonInput>
          </IonItem>
          <IonItem>
            <IonLabel position="floating">Date de naissance</IonLabel>
            <IonInput
              type="text"
              name="datedenaissance"
              id="datedenaissance"
            ></IonInput>
          </IonItem>
          <IonItem>
            <IonLabel position="floating">E-mail</IonLabel>
            <IonInput
              placeholder="example@gmail.com"
              type="email"
              name="mail"
              id="mail"
            ></IonInput>
          </IonItem>
          <IonItem>
            <IonLabel position="floating">mot de passe</IonLabel>
            <IonInput type="password" name="mdp" id="mdp"></IonInput>
          </IonItem>
          <IonItem>
            <IonLabel position="floating">mot de passe</IonLabel>
            <IonInput type="password" name="mdp" id="mdp"></IonInput>
          </IonItem>
          <div className="button-wrapper">
            <IonButton type="submit">valider</IonButton>
          </div>
        </form>
      </IonContent>
    </IonPage>
  );
};

// export default Details;
export default InscriptionPage;
